        return -1
    count = [0] * 256
    for i in range(len(str1)):
        count[ord(str1[i])] += 1
        count[ord(str2[i])] -= 1
    for i in range(256):
        if count[i] != 0:
            return -1
    visit = [0] * len(str1)
    answer = 0
    for i in range(len(str1)):
        if visit[i] or str1[i] == str2[i]:
            continue
        cycle_size = 0
        j = i
        while not visit[j]:
            visit[j] = 1
            j = str1.index(str2[j])
            cycle_size += 1
        if cycle_size > -1:
            answer += cycle_size - 1
    return answer

